function Navbar(){
    return(
        <header>
            <h1 class="logo">React</h1>
            <div>click here</div>
            <navbar >
                <ul class="nav-lists">
                    <li>Home</li>
                    <li>About</li>
                    <li>Services</li>
                    <li>Team</li>
                    <li>Contact</li>
                </ul>
            </navbar>
        </header>
    );
}

export default Navbar;
